module.exports = JSON.parse("{\"committee_divisions\":[{\"division\":\"External Committees\",\"committees\":[{\"name\":\"Arts\",\"description\":\"The Arts Committee is at the forefront of creatively connecting and engaging our community in a variety of ways. Currently, our members can embark on projects such as our birthday banners that are posted in the Yurt; help host events like “Painting with a Twist” and other collabs; create posters, designs, and any artistic needs for other committees; and oversee McGallery registration and displays.<br/><br/>If you’re looking for a way to flourish with your artistic skills, then this is the place for you—beyond just sharing what you love, you’ll have the chance to learn from members about many other art forms. Whether it’s music, dance, painting, theater, or more, we’re always open to bring more creativity to Murt! If you don’t see your chosen artistic passion in our current projects, we’re always happy to help new projects grow. :)\",\"heads\":[{\"name\":\"Nadia Thieriot\",\"email\":\"njt5@rice.edu\"},{\"name\":\"Ashley Zhang\",\"email\":\"acz5@rice.edu\"},{\"name\":\"Cielo Molina\",\"email\":\"cm155@rice.edu\"}],\"members\":[]},{\"name\":\"Alumni\",\"description\":\"Wondering how McMurtry alumni keep in touch with the best college at Rice? Look no further than the Alumni Committee. Our committee sends out a newsletter each semester during the school year to all McMurtry alums, updating them on what's going on at Rice and McMurtry. We also plan events at McMurtry that include alumni such as during Homecoming, McMurtry Day, and Beer Bike! Our goals are to reach out to the young, enthusiastic classes that just graduated our college and get them involved in making McMurtry's culture amazing.\",\"heads\":[{\"name\":\"Tomas Hradil\",\"email\":\"th68@rice.edu\"},{\"name\":\"Charlie Friz\",\"email\":\"cf56@rice.edu\"}],\"members\":[]},{\"name\":\"Associates\",\"description\":\"The Associates Committee serves as a liaison between McMurtry's students and associates. McMurtry associates are Rice faculty as well as adult professionals in the Houston area who are associated with Rice. They serve as mentors, friends, academic advisers, and general resources for students. The Associates Committee hosts intellectual events, monthly lunches, study breaks, holiday events, and a formal Associates' Night each semester. The committee also organizes O-week group lunches with associates, as well as a pre-O-week reception and dinner.\",\"heads\":[{\"name\":\"Grace Park\",\"email\":\"gcp3@rice.edu\"},{\"name\":\"Elsa Koenig\",\"email\":\"enk5@rice.edu\"}],\"members\":[]},{\"name\":\"Social Media and History\",\"description\":\"The historians are the link between current McMurtry and our past. They keep track of McMurtry history through photos, scrapbooks, articles, and the Rice archives. Even more than just recording the college history, they are capturing the history of each and every Murt student, so no one ever forgets their McMurtry experience.\",\"heads\":[{\"name\":\"Brianna Schulstad\",\"email\":\"bts8@rice.edu\"},{\"name\":\"Akshara Sankar\",\"email\":\"as386@rice.edu\"}],\"members\":[]},{\"name\":\"Murtchandise\",\"description\":\"The Murtchandise committee is responsible for the design and procurement of McMurtry merchanise.\",\"heads\":[{\"name\":\"Katie Lee\",\"email\":\"kl86@rice.edu\"},{\"name\":\"Grace Doolittle\",\"email\":\"ged1@rice.edu\"},{\"name\":\"Cal Mascardo (Spring)\",\"email\":\"ccm16@rice.edu\"}],\"members\":[]},{\"name\":\"Sports\",\"description\":\"The Intramural Sports committee serves several athletics-related roles, with the most important being getting Murts involved! By serving as liaison between McMurtry and IMS (the rec center), the sports committee works to promote both college and intramural sports, help people sign up, and represent McMurtry to IMS. Committee members also work with powerpuff (yay powderpuff!), work to get competing Murts in legit athletic swag, and generally love sports themselves.\",\"heads\":[{\"name\":\"Favour Alino\",\"email\":\"fca1@rice.edu\"},{\"name\":\"Jacob Andreini\",\"email\":\"jma21@rice.edu\"}],\"members\":[]},{\"name\":\"Traditions\",\"description\":\"The traditions committee is the link between current McMurtry and our past. They keep track of McMurtry history through photos, scrapbooks, articles, and the Rice archives. Even more than just recording the college history, they are capturing the history of each and every Murt student, so know one ever forgets their McMurtry experience.\",\"heads\":[{\"name\":\"Davinia Ibizugbe \",\"email\":\"doi1@rice.edu\"},{\"name\":\"Maia A. Fernández Nova\",\"email\":\"maf18@rice.edu\"}],\"members\":[]}]},{\"division\":\"Internal Committees\",\"committees\":[{\"name\":\"Amenities\",\"description\":\"The Amenities Committee is responsible for the improvement and upkeep of the public spaces (such as the lounges, TV room, game room, outside on 5th Floor, and hang-out area in the Commons) throughout McMurtry. Each member of our committee is in charge of managing one space - and we’re open to any suggestions! We focus on creating a pleasant atmosphere throughout the college with rooms and amenities all students can utilize. The Amenities Committee strives to implement long-lasting enhancements that can be enjoyed by Murts for years to come!\",\"heads\":[{\"name\":\"Alison Colvis\",\"email\":\"alc15@rice.edu\"},{\"name\":\"Kef Nkosi\",\"email\":\"kn35@rice.edu\"},{\"name\":\"Mustafa Latif (Tech)\",\"email\":\"ml123@rice.edu\"}],\"members\":[]},{\"name\":\"Culinary\",\"description\":\"The culinary committee serves as the liaisons between the college and the West Servery chefs. Any suggestions you have for how West servery could be improved goes to us. We also maintain the kitchens throughout McMurtry, including Burts, and occasionally host fun food-related events in Burts. We also provide cookies for every Baker 13 defense. If you love food, either cooking or eating, join us!\",\"heads\":[{\"name\":\"Joanna Coram\",\"email\":\"jnc3@rice.edu\"},{\"name\":\"Cara Brown\",\"email\":\"cb116@rice.edu\"},{\"name\":\"Maddy Whelley\",\"email\":\"mw127@rice.edu\"}],\"members\":[]},{\"name\":\"Environmental\",\"description\":\"The Environmental Committee exists at McMurtry to keep the college's effect on Earth in the minds of every Murt. This committee aims to help raise awareness about the little things that everyone can do to reduce the college's overall environmental impact.\",\"heads\":[{\"name\":\"Lauren Verthein\",\"email\":\"ljv2@rice.edu\"},{\"name\":\"Sofia Gachuz\",\"email\":\"sag10@rice.edu\"}],\"members\":[]},{\"name\":\"MIS\",\"description\":\"We supply, maintain, and plan events in the MIS to provide a great design space for students with all types of projects. Join us if you are interested in learning how to use the 3D printers and other cool tools in the space, hosting workshops for other students, helping decide what resources available in the space, or if you just want 24-hour access!\",\"heads\":[{\"name\":\"Lucas Dovalina\",\"email\":\"lbd1@rice.edu\"}],\"members\":[]},{\"name\":\"Website\",\"description\":\"The Website Committee works on developing and updating the McMurtry Website.\",\"heads\":[{\"name\":\"Stone Li\",\"email\":\"sjl10@rice.edu\"},{\"name\":\"Andrew Chu\",\"email\":\"ahc12@rice.edu \"}],\"members\":[]}]},{\"division\":\"Social Committees\",\"committees\":[{\"name\":\"External Socials\",\"description\":\"External Socials are simply put, very very social. We plan events that feature Murts interacting with other colleges, including McMurtry's public party and Pub night. Our goal is to create activities that every Murt would love to participate in and to find ways to make sure every member of our college feels connected to the community by simply doing FUN STUFF. We are always ready to hear any input that anyone might have, and we cannot wait to make this an amazing year!\",\"heads\":[{\"name\":\"Ariah Richards\",\"email\":\"amr25@rice.edu\"},{\"name\":\"Carlos Cruz\",\"email\":\"cc211@rice.edu\"},{\"name\":\"Catey Thomas\",\"email\":\"ct75@rice.edu\"}],\"members\":[]},{\"name\":\"Internal Socials\",\"description\":\"The Internal Socials committee - a group dedicated to fostering McMurtry spirit, bonding, and fun. But more importantly we’re dedicated to keeping McMurtry to as little studying as possible. The committee puts on various social events throughout the year including, but not limited to board game and movie nights, Fridays in the Quad, social mixer events and McSkate.\",\"heads\":[{\"name\":\"Gloria Ni\",\"email\":\"ggn1@rice.edu\"},{\"name\":\"Grace Doolittle\",\"email\":\"ged1@rice.edu\"},{\"name\":\"Brianna Schulstad\",\"email\":\"bts8@rice.edu\"}],\"members\":[]},{\"name\":\"Beer Bike\",\"description\":\"Beer Bike. Some say it's the best day of the year. Others say it's the best day of their lives (with the exception of the other Beer Bikes they were fortunate enough to attend). The Beer Bike Committee is in charge of making this monumentous day a reality for all of McMurtry to enjoy. Whether it be assisting the Biking or Chugging Teams, organizing water balloon filling, or rounding people up for an epic jack on… Duncan (of course) – there is something for everyone (including new students) to do!\",\"heads\":[{\"name\":\"Megan Worstell\",\"email\":\"mnw3@rice.edu\"},{\"name\":\"Arwyn St John\",\"email\":\"ats11@rice.edu\"},{\"name\":\"Gloria Ni\",\"email\":\"ggn1@rice.edu\"}],\"members\":[]},{\"name\":\"Seniors\",\"heads\":[{\"name\":\"Jasir Rahman\",\"email\":\"jkr6@rice.edu\"},{\"name\":\"Zoe Wang\",\"email\":\"zyw1@rice.edu\"},{\"name\":\"Sabrina Sun\",\"email\":\"ys96@rice.edu\"}],\"members\":[]}]},{\"division\":\"At-Large Committees\",\"committees\":[{\"name\":\"Culturals\",\"description\":\"The McMurtry Cultural Committee exists to engage students in the diversity of the Houston community. Currently, Culturals subsidizes ethnic restaurants along the METRO-rail, provides themed study breaks, and is responsible for the college Hookah, amongst other fascinating cultural things. The committee also facilitates opportunities for free events and shows in Houston through a liaison with RPC. Here mostly to provide McMurtry with free food and concerts, the Cultural Committee ensures McMurtry is never short of fun things to do both within and beyond the hedges.\",\"heads\":[{\"name\":\"Carlos Cruz\",\"email\":\"cc211@rice.edu\"},{\"name\":\"Katie Voong\",\"email\":\"kv31@rice.edu\"}],\"members\":[]},{\"name\":\"Diversity\",\"description\":\"The McMurtry Diversity Council aims to foster a sense of community while also respecting and celebrating individuality. We work to implement policies that create an environment of inclusion, comfort, empathy, and representation of people of diverse experiences, identities and cultures. We achieve this by conducting frequent open forums, identifying issues in the college, formulating sustainable solutions, and educating committees, leaders, and the community.\",\"heads\":[{\"name\":\"Sohani Sandhu\",\"email\":\"sks15@rice.edu\"},{\"name\":\"Ashley Ramirez \",\"email\":\"amr28@rice.edu\"}],\"members\":[]}]}]}");

